void
AnimatorMode::updateRateTimeoutSlot ()
{

  m_updateRateTimer->stop ();
  if (m_currentTime >= m_pauseAtTime)
    {
      externalPauseEvent ();
      m_pauseAtTimeTriggered = true;
      m_pauseAtTime = 65535;
      return;
    }
  if (m_state == SIMULATION_COMPLETE)
    return;
  if (m_playing)
    {
      if (!OnlineMode)
      {
        dispatchEvents ();
      }
      else
      {
        TimeValue<AnimEvent*>::TimeValueResult_t result;
        m_events.getNextGOOD (result);
        if (result != m_events.GOOD)
        {
          eventObtained = false;
          ns3::Simulator::Run ();
          if (eventObtained)
          {
            setCurrentTime (nextTs);
            dispatchEvents ();
          }

        }
        else
        {
          dispatchEvents ();
        }
        if (ns3::Simulator::IsFinished ())
        {
          setSimulationCompleted ();
          return;
        }
      }

      disconnect (m_simulationTimeSlider, qFlagLocation("2""valueChanged (int)" "\0" "animatormode.cpp" ":" "1326"), this, qFlagLocation("1""updateTimelineSlot (int)" "\0" "animatormode.cpp" ":" "1326"));
      m_simulationTimeSlider->setValue (m_currentTime);
      connect (m_simulationTimeSlider, qFlagLocation("2""valueChanged (int)" "\0" "animatormode.cpp" ":" "1328"), this, qFlagLocation("1""updateTimelineSlot (int)" "\0" "animatormode.cpp" ":" "1328"));
      m_qLcdNumber->display (m_currentTime);
      keepAppResponsive ();
      if (m_showPropertiesButton->isChecked ())
        {
          AnimPropertyBroswer::getInstance ()->refresh ();
        }
      m_updateRateTimer->start ();

    }
}

